import React from "react";
import { Navbar, Container, NavDropdown } from "react-bootstrap";
import { FaUserCircle } from "react-icons/fa";

const TopNavbar = () => {
  return (
    
      <Navbar bg="dark" variant="dark" expand="md"className="ps-2">
        <Container fluid className="d-flex align-items-center justify-content-between">
          <div className="d-flex align-items-center">
            <img src="/Gtlogo2.png" alt="logo" className="me-2" style={{ width: 36, height: 36 }}/>
            <span className="navbar-brand mb-0 fs-4 fw-bold px-2">
              Admin Dashboard
            </span>
          </div>

          
          <div className="d-flex align-items-center">
            <NavDropdown align="end" title={<FaUserCircle size={24} color="white" />} id="user-dropdown" menuVariant="dark" >
              <NavDropdown.Item href="#profile">Profile</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#logout" className="text-danger">
                Logout
              </NavDropdown.Item>
            </NavDropdown>
          </div>
        </Container>
      </Navbar>
    
  );
};

export default TopNavbar;
